import React from 'react';
import { NavLink } from 'react-router-dom';
import { Nav } from '../Componentes/Nav';
import { BlogPage } from './BlogPage';

function Menu(){
    return(
 <>
        {routes.map(route => (

                <Nav link={route.to}>
                <NavLink

                    to={route.to} >
                    {route.text}
                </NavLink>
                </Nav>
        ))}
</>
    )
}

const routes = [];

routes.push({
    to:'/',
    text:'home'
})
routes.push({
    to:'aprende/articulos/',
    text:'blog'
})
routes.push({
    to:'/profile',
    text:'profile'
})

export {Menu}
